// import {QuizRound} from "../model/QuizRoundModel";
import {FetchMethod} from "./enu";

export const request = async (url: string, method: FetchMethod): Promise<string, string> => {
  const rawResponse = await fetch(url, {method});

  throw new Error(String(rawResponse.status));
};
